package bruteforce;import java.util.HashSet;import java.util.Set;public class B4673 {    public static void main(String[] args) {        Set<Integer> set = new HashSet<>();        for (int i = 1; i <= 10000; i++) {            int num = d(i);            if (num <= 10000) set.add(num);        }        for (int i = 1; i <= 10000; i++) {            if (!set.contains(i)) {                System.out.println(i);            }        }    }    public static int d(int n) {        String[] arr = String.valueOf(n).split("");        int temp = 0;        for (String num : arr) {            temp += Integer.parseInt(num);        }        return n + temp;    }}